    18,nt"tags": [],nt"title": "SALINITY, CONDUCTIVITY, HYDROSTATIC PRESSURE,
    TEMPERATURE and FLUORESCENCE profile data collected in the North Atlantic Ocean
    on NOAA Ship ALBATROSS IV, ENDEAVOR and OCEANUS cruises AL9505, AL9506 and others
    as part of the GB project from 1995-02-11 to 1996-06-11 (NODC Accession 0104387)",nt"tracking_summary":
    {ntt"total": 1,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-10-04T01:07:59.601560",nt"name": "salinity-conductivity-hydrostatic-pressure-temperature-and-fluorescence-profile-data-collected-",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0104387 includes profile,
    discretely sampled, biological, physical and chemical data collected aboard NOAA
    Ship ALBATROSS IV, ENDEAVOR and OCEANUS during cruises AL9505, AL9506, AL9508, AL9605,
    AL9607, EN261, EN263, EN265, EN276, EN278, EN282 and OC275 in the North Atlantic
    Ocean from 1995-02-11 to 1996-06-11. These data include SALINITY, CONDUCTIVITY,
    HYDROSTATIC PRESSURE, TEMPERATURE and FLUORESCENCE. The instruments used to collect
    these data include CTD. These data were collected by David Mountain and Maureen
    Taylor of National Marine Fisheries Service as part of GB. The Biological and Chemical
    Oceanography Data Management Office (BCO-DMO) submitted these data to NODC on 2013-01-19.nnThe
    following is the text of the abstract provided by BCO-DMO:nnWater column properties,nBroadscale
    CTD stations, 1995 and 1996.nPI NOTES:nThe 1995 and 1996 bottle data were collected
    with a GO rosette mounted above the MK5 CTD. The temperature, conductivity, salinity,
    and fluorescence data were collected from the CTD data stream when the bottle was
    tripped (~30 scans are averaged).nThe companion object which includes the raw chlorophyll
    and phaeophytin values for these same cruises is chloro_bottle.nnContacts for the
    data:nDavid MountainnNMFSnWoods Hole, MA 02543n508-495-2271nDavid.Mountain@noaa.gov
